import React from "react";
import "./Sidebar.css";
import SidebarOption from "./SidebarOption";
// import TwitterIcon from "@material-ui/icons/Twitter";
import TwitterIcon from "@material-ui/icons/Twitter";
import NoctuaIcon from "%PUBLIC_URL%/logo.ico";
import HomeIcon from "@material-ui/icons/Home";
import SearchIcon from "@material-ui/icons/Search";
import NotificationsNoneIcon from "@material-ui/icons/NotificationsNone";
import MailOutlineIcon from "@material-ui/icons/MailOutline";
import BookmarkBorderIcon from "@material-ui/icons/BookmarkBorder";
import ListAltIcon from "@material-ui/icons/ListAlt";
import PermIdentityIcon from "@material-ui/icons/PermIdentity";
import MoreHorizIcon from "@material-ui/icons/MoreHoriz";
import { Button } from "@material-ui/core";

function Sidebar() {
  return (
    <div className="sidebar">
      {/* <TwitterIcon className="sidebar__twitterIcon" /> */}
      <link rel="icon" href="%PUBLIC_URL%/logo.ico" />
      <SidebarOption Icon={HomeIcon} text="Acceuil" active={true} />
      <SidebarOption Icon={SearchIcon} text="Explorer" />
      <SidebarOption Icon={NotificationsNoneIcon} text="Notifications" />
      <SidebarOption Icon={MailOutlineIcon} text="Messages" />
      <SidebarOption Icon={BookmarkBorderIcon} text="Signets" />
      <SidebarOption Icon={ListAltIcon} text="Listes" />
      <SidebarOption Icon={PermIdentityIcon} text="Profil" />
      <SidebarOption Icon={MoreHorizIcon} text="Plus" />

      <Button variant="outlined" className="sidebar__tweet" fullWidth>
        Noctua
      </Button>
    </div>
  );
}

export default Sidebar;
